  false,\n\t\"url\": null,\n\t\"notes\": \"The State Departments issues Travel Alerts
  for short-term events we think you should know about when planning travel to a country.
  Examples of reasons for issuing a Travel Alert might include an election season
  that is bound to have many strikes, demonstrations, disturbances; a health alert
  like an outbreak of H1N1; or evidence of an elevated risk of terrorist attacks.
  When these short-term events are over, we cancel the Travel Alert.\",\n\t\"license_title\":
